// SPDX-License-Identifier: GPL-3.0

pragma solidity 0.7.0;

contract RolloverExample {
    uint8 public myUint8;
    
    function setMyUint8(uint8 _myUint8) public {
        myUint8 = _myUint8;
    }

    function decrement() public {
        myUint8--;
    }

    function increment() public {
        myUint8++;
    }
}
